import React from 'react';
import styled from 'styled-components';

const Card = (props) => {
    return (
        <CardContainer>
            <img src= {props.img} alt={props.alt} />
            <h3>{props.title}</h3>
            <p>{props.content}</p>
        </CardContainer>
    )
};

const CardContainer = styled.div`
width: 40%;

img {
    width: 100%;
    height: auto;
}

h3 {
    font-family: 'Poppins', sans-serif;
    font-size: 35px;
    font-weight: 200;
    line-height: 35px;
    color: rgb(59, 94, 103);
}

p {
    font-family: 'Poppins', sans-serif;
    color: #033B4A;
    width: 100%;
    font-size:15px;
    font-weight: 400;
    line-height: 27px;
}
`

export default Card;
